export default class Currency{

 constructor(code, name) {
  this.code = code;
  this.name = name;
 }

 set name(name) {
 this._name = name;
 }

 set code(code) {
 this._code = code;
 }	

 get code() {
 return this._code;
 }

 get name() {
 return this._name;
 }

 displayFullCurrency() {
 return `${this._name}(${this._code})`;
 }	

}
